export const findPredicateVersionById = (id: string) => {
  const version = predicateVersions.find(({ id }) => id === id);
  if (version) {
    return version;
  } else {
    throw new Error('Version not found');
  }
};

export const findPredicateVersionByCode = (code: string) => {
  const version = predicateVersions.find(({ code }) => code === code);
  if (version) {
    return version;
  } else {
    throw new Error('Version not found');
  }
};

